import {Component} from 'react'

import Button from '../../form/Button'


class Index extends Component {

    constructor(props) {
        super(props);

    }

    _handleLogin = () => {
        console.log('logout!')
    }

    render() {

        return (
            <div className="d-flex align-items-center" style={{width:'100%', backgroundColor: "white", height: 70, paddingLeft: 25, paddingRight:25}}>

                <img src="/static/logo.png" style={{objectFit:'contain', height:25, cursor:'pointer', marginRight: 25}}/>

                <div>
                    Dashboard  Schedule  Analytics
                </div>

                <Button
                    _Function={this._handleLogin}
                    title={'Logout'}
                    style={{backgroundColor:"white"}}
                />
            </div>
        );

    }
} 

export default Index;
